import React from 'react';
import { Col, Container, Row } from 'reactstrap';
import "../styles/home.css"

const Home = () => {
  return (
    <>
      {/* ============ hero section start =========== */}
      <section className='hero-section'>

          <Row>
            <Col lg='12'>
              <div className='hero-background'></div>
            </Col>
          </Row>

      </section>
      {/* ============ hero section end =========== */}

    </>
  );
};


export default Home;
